generated.css:
.pcontainer {
    border-radius: 5px;
    background-color: #f2f2f2;
    margin: 50px 350px;
    padding: 10px 30px;
    overflow: hidden;
    width: 35%;
}


.photo {
    margin: 10px 120px;

}
.photo img {
    border-radius: 50px;
    max-height: 250px;
}

ul {
    background: #0A0908;
    border-radius: 4px;
    display: flex;
    flex-direction: row;
    overflow: hidden;
    margin: 0;
    padding: 0;
}
ul li {
    list-style: none;
    flex-grow: 1;
    float: left;
    text-align: center;
    width: 16.6667%;
    /* fallback for non-calc() browsers */
    width: calc(100% / 6);
}
ul li a {
    display: block;
    text-decoration: none;
    color: #F2F4F3;
    padding: 15px 0;
}
ul li a:hover {
    background-color: #292D28;
    color: ivory;
}
h6 {
    color: cadetblue;
    margin-left: 40px;
    font-family: sans-serif;
    font-size: 1.2em;
}
.pinfo {
    color: cadetblue;
}
h4 {
    padding-bottom: 10px;
    padding-top: 10px;
    color: cadetblue;
}
input[type=file] {

    background-color: gainsboro;
    border-radius: 4px;
    cursor: pointer;
}
.pform label {
    color: #0D89C6;
    padding-bottom: 20px;
}

 @media screen and (max-width: 1024px) {
    .pcontainer {
        width: 60%;
        margin-left:40px;
        padding: 4px;
    }
    .photo {
        margin: 5px 5px;
    }
}

@media screen and (max-width: 812px) {
    .pcontainer {
        margin-left: 40px;
        width: 70%;
    }
}
